INSERT INTO `article` VALUES ('31', '60', '监管应兼顾金融和网络特征', '1', '1', '细数那些“看不见”的影子银行01', '2014-03-31 14:35:02', null, null, 'to/article-1-60-31.htm'), ('32', '60', '银监会与央行联合下发《关于加强商业银行与第三方支付机构合作业务管理的通知》', '1', '1', '细数那些“看不见”的影子银行02', '2014-03-31 14:35:21', null, null, 'to/article-1-60-32.htm'), ('33', '60', '浅谈2014年P2P网贷行业关键词：跑马圈地', '1', '1', '细数那些“看不见”的影子银行03', '2014-03-31 14:35:35', null, null, 'to/article-1-60-33.htm'), ('34', '60', '细数那些“看不见”的影子银行04', '0', '0', '细数那些“看不见”的影子银行04', '2014-03-31 14:35:49', null, null, 'to/article-1-60-34.htm'), ('35', '60', '细数那些“看不见”的影子银行05', '0', '0', '细数那些“看不见”的影子银行05', '2014-03-31 14:36:01', null, null, 'to/article-1-60-35.htm'), ('43', '61', '什么是P2P网贷？P2P网贷违法吗', '1', '1', '什么是P2P网贷？P2P网贷违法吗？', '2014-04-04 15:14:18', null, null, 'to/article-1-61-43.htm'), ('44', '61', 'P2P网贷有哪些风险？', '1', '1', 'P2P网贷有哪些风险？', '2014-07-17 14:49:34', null, null, 'to/article-1-61-44.htm'), ('45', '61', '会员为什么要进行身份认证？', '1', '1', '会员为什么要进行身份认证？', '2014-07-17 14:49:57', null, null, 'to/article-1-61-45.htm'), ('46', '61', '电子合同有效吗？', '1', '1', '电子合同有效吗？', '2014-07-17 14:50:17', null, null, 'to/article-1-61-46.htm'), ('47', '61', '什么是按月等额本息还款？', '1', '1', '什么是按月等额本息还款？', '2014-07-17 14:50:44', null, null, 'to/article-1-61-47.htm'), ('48', '20', '富爸爸国庆放假工作安排通知', '1', '1', '<p><a style=\"margin: 0px; padding: 0px; list-style: none; outline: none; font-size: 14px; font-family: 微软雅黑, \'Microsoft YaHei\'; color: rgb(0, 66, 118); cursor: pointer; line-height: 21px;\"></a><span style=\"font-size:16px;color:#333333;\">尊敬的富爸爸会员：</span></p><p><span style=\"font-size:16px;color:#333333;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 国庆长假即将来临，富爸爸全体员工祝您国庆快乐！</span></p><p><span style=\"font-size:16px;color:#333333;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 根据国务院对2014年节假日安排的通知，并结合我司实际情况，我司国庆期间将做如下安排：</span></p><p><span style=\"font-size:16px;color:#333333;\">1）10月1日至10月7日放假；（提现申请正常）。为了方便大家及时收款，建议您使用工商银行、招商银行、农业银行、交通银行提现。</span></p><p><span style=\"font-size:16px;color:#333333;\">&nbsp;2）假期前最后的审核时间为9月30日18:00，未处理放款将会在10月7日10；00之后放款。</span></p><p><span style=\"font-size:16px;color:#333333;\">&nbsp;3 ）国庆期间充值还款功能正常，请需到期还款的用户提前做好相应安排，以免造成不必要的损失。</span></p><p><span style=\"font-size:16px;color:#333333;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 金秋十月国庆至，送你十一种祝福：快乐、开心、平安、健康、甜蜜、美丽、魅力、成功、顺利、如意、幸福，世间所有的美好都送给你，愿你事业顺利，家庭幸福，爱情甜蜜，友情永伴，平安一生，国庆快乐！</span></p><p><span style=\"font-size:16px;color:#333333;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 感谢您对富爸爸长久以来的支持！</span></p><p><span style=\"font-size:16px;color:#333333;\"><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 深圳市富爸爸电子商务有限公司</span></p><p><span style=\"font-size:16px;color:#333333;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 客服团队</span></p><br />', '2014-08-09 10:50:31', null, null, 'to/article-1-20-48.htm'), ('49', '20', '富爸爸系统升级公告', '1', '1', '<p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">尊敬的用户：</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">您好！</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 为提升网站运营质量，深圳市富爸爸电子商务有限公司（以下简称“富爸爸”）于近日采购了新的服务器，并重新对系统进行了部署和升级。</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 此次升级预计将于2014年10月7日上午9:00完成。在此过程中，由于系统调试个别用户可能会遇到网站无法登陆或还款失败导致逾期的问题。如果您在进行充值或还款操作的过程中遇到任何问题请直接联系富爸爸客服人员，我们会在系统升级完成后第一时间为您解决。</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 对于此次升级过程中给您造成的不便我们深表歉意！</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 同时，感谢您在我们的发展过程中一直给予的帮助和支持！我们会不断努力完善为您提供更加优质的服务！</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 深圳市富爸爸电子商务有限公司</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 客服部</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;