-- ----------------------------
--  Table structure for `collectrecord`
-- ----------------------------
DROP TABLE IF EXISTS `collectrecord`;
CREATE TABLE `collectrecord` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `loanSign_id` bigint(20) DEFAULT NULL COMMENT '借款标编号',
  `userbasicinfo_id` bigint(20) DEFAULT NULL COMMENT '会员编号',
  `collecttime` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKDDD6C5FBF0EB5EBA` (`userbasicinfo_id`),
  KEY `FKDDD6C5FB554723AD` (`loanSign_id`),
  CONSTRAINT `FKDDD6C5FB554723AD` FOREIGN KEY (`loanSign_id`) REFERENCES `loansign` (`id`),
  CONSTRAINT `FKDDD6C5FBF0EB5EBA` FOREIGN KEY (`userbasicinfo_id`) REFERENCES `userbasicsinfo` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `comment`
-- ----------------------------
DROP TABLE IF EXISTS `comment`;
CREATE TABLE `comment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `cmtContent` varchar(255) DEFAULT NULL COMMENT '评论内容',
  `cmtIsShow` varchar(255) DEFAULT NULL COMMENT '是否显示：1显示、0屏蔽',
  `cmtReply` varchar(255) DEFAULT NULL COMMENT '回复内容',
  `commentTime` varchar(255) DEFAULT NULL COMMENT '评论时间',
  `replyTime` varchar(255) DEFAULT NULL COMMENT '回复时间',
  `commentator_id` bigint(20) DEFAULT NULL COMMENT '评论人',
  `loanSign_id` bigint(20) DEFAULT NULL COMMENT '借款标',
  `replyer_id` bigint(20) DEFAULT NULL COMMENT '回复人',
  PRIMARY KEY (`id`),
  KEY `FK38A5EE5F491B7540` (`replyer_id`),
  KEY `FK38A5EE5F840DD79B` (`commentator_id`),
  KEY `FK38A5EE5F9C6DA5F7` (`loanSign_id`),
  CONSTRAINT `FK38A5EE5F491B7540` FOREIGN KEY (`replyer_id`) REFERENCES `adminuser` (`id`),
  CONSTRAINT `FK38A5EE5F840DD79B` FOREIGN KEY (`commentator_id`) REFERENCES `userbasicsinfo` (`id`),
  CONSTRAINT `FK38A5EE5F9C6DA5F7` FOREIGN KEY (`loanSign_id`) REFERENCES `loansign` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='借款标评论信息表';

-- ----------------------------
