INSERT INTO `deputysection` VALUES ('16', '0', '0', '首页', '16', '首页首页', '首页', 'to/single-1-17.htm', '1', '1', '0', '0'), ('17', '0', '1', '公司简介', '17', '<p><span style=\"font-family:Microsoft YaHei;font-size:18px;color:#333333;\">深圳市万绿创投电子商务有限公司（以下简称万绿创投）是经官方权威认证、工信部备案的网络借贷平台，它为借贷双方搭建了一个公开、公平、安全、高效的网上资金交易平台。借贷双方以招标、投标的方式在平台上自由交易，资金流转通过第三方支付完成。平台对资金借出方（理财人、投资人）给予投资安全保障，同时对资金借入方（贷款人、借款人）进行严格的贷前信用评估，贷中、贷后监督还款管理。</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:18px;color:#333333;\">万绿创投是国内首批网络借贷平台之一，主要为小微私营企业、个体工商户、企事业单位白领提供资产汽车抵押等金融服务，以满足经营创业需求，也可用于部分消费需要，同时为大家手中的闲钱提供了一个零风险的投资理财渠道。</span></p><p><span style=\"font-family:Microsoft YaHei;font-size:18px;color:#333333;\">万绿创投作为一种民间借贷新模式——P2P（个人对个人）网络借贷交易平台，它是互联网应用的广泛普及和货币数字化迅速发展的产物。这种模式最早于2005年在英国出现，由于它使借贷双方的资金交易方式灵活方便、快捷高效，推出后得到广泛发展，迅速在其它国家得以推广。自2007年进入中国以来，发展速度更是惊人，至今短短几年时间里，全国已有上百家交易平台，年交易额已过百亿。</span></p>', '公司简介', 'to/single-7-17.htm', '1', '7', '1', '0'), ('20', '1', '1', '最新公告', '20', '', '最新公告', 'to/list-1-20.htm', '2', '1', '0', '1'), ('24', '0', '1', '团队介绍', '24', '', '团队介绍', 'to/single-7-24.htm', '1', '7', '0', '0'), ('26', '0', '1', '最新动态', '26', '', '最新动态', 'to/single-7-26.htm', '1', '7', '0', '0'), ('56', '0', '1', '行业新闻', '56', '', '行业新闻', 'to/single-7-56.htm', '1', '7', '0', '0'), ('60', '0', '0', '热点动态', '60', '', '热点动态', 'to/list-1-60.htm', '2', '1', '0', '0'), ('61', '0', '0', '问题解答', '61', '', '问题解答', 'to/list-1-61.htm', '2', '1', '0', '0'), ('69', '0', '0', '加入我们', '69', '', '加入我们', 'to/single-7-69.htm', '1', '7', '1', '0'), ('71', '0', '1', '万薪贷', '71', '<span style=\"font-family:Microsoft YaHei;font-size:15px;line-height:25px;color:#333\">一款为广大工薪阶层白领精英人群提供的无抵押信用贷款产品</span><br /><span style=\"font-family:Microsoft YaHei;font-size:15px;margin:15px 0 0 30px;display:block;line-height:25px;width:100%;color:#333\"><span style=\"float:left;font-family:Microsoft YaHei;font-size:15px;color:#333\">申请条件：</span><span style=\"float:left;font-family:Microsoft YaHei;font-size:15px;color:#333\">1.年龄