         </p>            </div>             <div>            <h4 class=\"porcListHxBox\"><span class=\"curvyCorners_t5\">申请资料</span></h4>            <p>             （1）正面、免冠、清晰的本人照片。<br />             （2）本人第二代身份证扫描件正、反面各一张（姓名和身份证号码清晰可见）。<br />             （3）已婚证明或未婚证明。<br />             （4）个人信用报告；（可以去银行打印）<br />             （5）盖有单位公章的劳动合同或工作证明。<br />             （6）连续近6个月工资卡银行流水。<br />             （7）其他有价资产及证明。            </p>              <a href=\"#\" class=\"porjectInfoMore curvyCorners_5\">查看详细信息</a>            </div>           ', '万绿产品', 'to/single-1-87.htm', '1', '1', '0', '0'), ('91', '1', '0', '问题解答', '0', null, '问题解答', 'to/list-1-91.htm', '2', '1', '0', '0'), ('92', '0', '1', '公司介绍', '92', '', '公司介绍', 'to/single-10-92.htm', '1', '10', '0', '1'), ('93', '0', '1', '管理团队', '0', null, '管理团队', 'to/single-10-93.htm', '1', '10', '0', '1'), ('94', '0', '1', '合作伙伴', '0', null, '合作伙伴', 'to/single-10-94.htm', '1', '10', '0', '1'), ('95', '0', '1', '联系我们', '0', null, '联系我们', 'to/single-10-95.htm', '1', '10', '0', '1'), ('96', '0', '1', '加入我们', '96', '', '加入我们', 'to/single-10-96.htm', '1', '10', '0', '0'), ('97', '0', '1', '网站地图', '97', '', '网站地图', 'to/single-10-97.htm', '1', '10', '0', '0'), ('98', '0', '1', '平台公告', '0', null, '平台公告', 'to/single-11-98.htm', '1', '11', '0', '1'), ('99', '0', '1', '行业新闻', '0', null, '行业新闻', 'to/single-11-99.htm', '1', '11', '0', '1'), ('100', '0', '1', '投资技巧', '0', null, '投资技巧', 'to/single-11-100.htm', '1', '11', '0', '1'), ('101', '0', '1', '常见问题', '0', null, '常见问题', '/to/single-11-101.htm', '1', '11', '0', '1'), ('102', '0', '1', '标的认证说明', '102', '<strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#FF9900;font-size:10.5pt;\">“富担标”认证标&nbsp; </span></strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><img src=\"/upload/default/columnimg/20141004145204.jpg\" alt=\"\" /><br /></span><p><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\">小额贷款公司、担保公司以及典当行，被简称为“富担标”。“富担标”认证标是指深圳市富爸爸电子商务有限公司（以下简称“富爸爸”）的合作伙伴“富担标”公司为相应借款承担连带担保责任的借款标的。若项目还款期限到期，实际借款人无法清偿项目本金和利息，“富担标”公司有义务为该债权承担连带担保责任，支付投资人本金与利息，充分保证投资者本金安全和利息收入。</span></p><p><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#FF9900;font-size:10.5pt;\">担保认证标&nbsp;</span></strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"> <img src=\"/upload/default/columnimg/20141004133934.jpg\" alt=\"\" /></span></span></p><p><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\">是富爸爸推出的一款以第三方公司为融资项目提供担保的一款产品。若项目到期，不管实际借款人是否还款，第三方公司都将确保偿付投资人本金与利息，将投资人投资风险降到最低。</span></span></p><p><strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#FF9900;\">抵押认证标&nbsp; </span></strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><img src=\"/upload/default/columnimg/20141004134037.jpg\" alt=\"\" /><br /></span></span></p><p><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\">富爸爸为满足投资人投资低风险需求，要求项目融资方提供相应价值抵押物而推出的一款产品。项目融资方提供相应的抵押物后，若到期融资方未能归还本金，则抵押物将被处置以偿付投资人的本金与利息，充分保障投资人本金安全与利息收入。</span></span></p><p><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#FF9900;font-size:10.5pt;\">信用认证标&nbsp; </span></strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><img src=\"/upload/default/columnimg/20141004134131.jpg\" alt=\"\" /><br /></span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\">是富爸爸通过对项目实际借款人的个人信用资质进行全面审核后，再通过富爸爸专业的风控团队重重审核，在富爸爸网站上发布的产品。</span></span></p><p><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#FF9900;font-size:10.5pt;\">实地认证标&nbsp; </span></strong><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\"><img src=\"/upload/default/columnimg/20141004134240.jpg\" alt=\"\" /><br /></span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#424344;font-size:10.5pt;\">是富爸爸专业风控团队进一步进行实地考察，了解项目实情。实地认证标相对信用认证标增添了富爸爸专业风控团队实地认证审核，进一步保障了投资者资金安全，减少了风险。</span><br /></span></p>', '标的认证说明', 'to/single-12-102.htm', '1', '12', '0', '1'), ('103', '0', '1', '合作企业', '0', null, '合作企业', 'to/single-12-103.htm', '1', '12', '0', '1'), ('104', '0', '1', '保障金制度', '0', null, '保障金制度', 'to/single-12-104.htm', '1', '12', '0', '1'), ('105', '0', '1', '风险控制图', '0', null, '风险控制图', 'to/single-12-105.htm', '1', '12', '0', '1'), ('109', '0', '1', '开放式平台介绍', '109', '', '开放式平台介绍', 'to/single-4-109.htm', '1', '4', '0', '0'), ('110', '0', '0', '理财产品介绍', '110', '', '理财产品介绍', 'to/single-2-110.htm', '1', '2', '0', '0'), ('111', '0', '1', '理财计划', '111', '', '理财计划', 'loaninfo/getYouxuanInfo.htm', '1', '2', '0', '0'), ('112', '0', '1', '散标投资', '112', '', '散标投资', 'loaninfo/openLoan.htm', '1', '2', '0', '0'), ('113', '0', '1', '债权转让', '113', '', '债权转让', 'loaninfo/openLoanCir.htm', '1', '2', '0', '0'), ('114', '0', '0', '还款黑名单', '114', '', '还款黑名单', 'to/single-2-114.htm', '1', '2', '0', '0'), ('115', '0', '1', '进入开发式平台', '0', null, '进入开发式平台', 'to/single-4-115.htm', '1', '4', '0', '0'), ('116', '0', '1', '加入我们', '0', null, '加入我们', 'to/single-7-116.htm', '1', '7', '0', '0'), ('117', '0', '1', '联系我们', '0', null, '联系我们', 'to/single-7-117.htm', '1', '7', '0', '0'), ('118', '1', '1', '理财方案', '0', null, '理财方案', 'to/list-1-118.htm', '2', '1', '0', '1'), ('119', '0', '1', '业绩报告', '0', null, '', 'to/single-7-119.htm', '1', '7', '0', '0');
