INSERT INTO `outline` VALUES ('1', '/upload/banner/intro_1.png', '1', '', '<div style=\"width:200px\">\n<h2 style=\"text-align:center\">投资理财</h2>\n<p style=\"text-align: center;\">简单4步注册成为投资人，享受50元起投超低门槛以及12%-15%稳定高额年化收益。更可以自主设置自动投标，让您理财更便捷。</p>\n</div>'), ('2', '/upload/banner/intro_2.png', '1', '', '<div style=\"width:200px\">\n<h2 style=\"text-align:center\">借款融资</h2>\n<p style=\"text-align: center;\">提交资料审核成功后成为借款人，通过考察划拨额度、发布借款标融资 。资料、手续齐全最快当天放款。</p>\n</div>'), ('3', '/upload/banner/intro_3.png', '1', '', '<div style=\"width:200px\">\n<h2 style=\"text-align:center\">安全保障</h2>\n<p style=\"text-align: center;\">严格的风控流程降低风险，加入本息保障计划可享受100%本息担保。更 有风险准备金兜底，第三方担保驻阵。</p>\n</div>');
COMMIT;

