-- ----------------------------
DROP TABLE IF EXISTS `usermessage`;
CREATE TABLE `usermessage` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `context` varchar(300) DEFAULT NULL COMMENT '发送内容',
  `isread` int(1) DEFAULT NULL COMMENT '是否已读（0未读 1已读）',
  `receivetime` varchar(30) DEFAULT NULL COMMENT '发送时间',
  `title` varchar(256) DEFAULT NULL COMMENT '标题',
  `user_id` bigint(20) DEFAULT NULL COMMENT '接收人',
  PRIMARY KEY (`id`),
  KEY `FKC3B449DC892F9557` (`user_id`),
  CONSTRAINT `FKC3B449DC892F9557` FOREIGN KEY (`user_id`) REFERENCES `userbasicsinfo` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=427 DEFAULT CHARSET=utf8 COMMENT='用户站内消息表';

