-- ----------------------------
--  Procedure structure for `PROCEDURE_REPAYMENT_MONEY`
-- ----------------------------
DROP PROCEDURE IF EXISTS `PROCEDURE_REPAYMENT_MONEY`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `PROCEDURE_REPAYMENT_MONEY`(
	IN mymoney DECIMAL(18,4),IN ipsNumber VARCHAR(30),IN interest DECIMAL(18,4),IN money DECIMAL(18,4),IN penalty DECIMAL(18,4),IN time VARCHAR(30),IN userid BIGINT,IN loanid BIGINT,IN state INT,IN managementFee DECIMAL(18,4)
)
BEGIN
	UPDATE userfundinfo SET cashBalance=mymoney WHERE id=userid; 
	IF money<0 THEN
		INSERT INTO accountinfo(money,income,expenditure,loansign_id,userbasic_id,time,explan,accounttype_id,ipsNumber) VALUES(mymoney+interest+penalty,0.00,ABS(money),loanid,userid,time,'本金',4,ipsNumber);
		INSERT INTO accountinfo(money,income,expenditure,loansign_id,userbasic_id,time,explan,accounttype_id,ipsNumber) VALUES(mymoney+penalty,0.00,ABS(interest),loanid,userid,time,'利息',4,ipsNumber);
		IF penalty>0 THEN
			INSERT INTO accountinfo(money,income,expenditure,loansign_id,userbasic_id,time,explan,accounttype_id,ipsNumber) VALUES(mymoney,0.00,ABS(penalty),loanid,userid,time,'违约金',15,ipsNumber);
		END IF;
	ELSE
		INSERT INTO accountinfo(money,income,expenditure,loansign_id,userbasic_id,time,explan,accounttype_id,ipsNumber) VALUES(mymoney-interest-penalty+managementFee,money,0.00,loanid,userid,time,'本金',3,ipsNumber);
		INSERT INTO accountinfo(money,income,expenditure,loansign_id,userbasic_id,time,explan,accounttype_id,ipsNumber) VALUES(mymoney-penalty+managementFee,interest,0.00,loanid,userid,time,'利息',3,ipsNumber);
		INSERT INTO accountinfo(money,income,expenditure,loansign_id,userbasic_id,time,explan,accounttype_id,ipsNumber) VALUES(mymoney-penalty,0.00,managementFee,loanid,userid,time,'管理费',3,ipsNumber);
		IF penalty>0 THEN
			INSERT INTO accountinfo(money,income,expenditure,loansign_id,userbasic_id,time,explan,accounttype_id,ipsNumber) VALUES(mymoney,penalty,0.00,loanid,userid,time,'违约金',15,ipsNumber);
		END IF;
	END IF;
	IF state=1 THEN
	-- 修改用户的冻结金额
		UPDATE userfundinfo SET frozenAmtN=frozenAmtN+money+interest+penalty WHERE id=userid;  
	END IF;
END
 ;;
delimiter ;

